import { Route, Routes } from 'react-router-dom';
import Circle from './Circle';
import Intro from './Intro';

function Sections() {
    return (
        <Routes>
            <Route path="/" element={<Intro />}>
                <Route path="destination" element={<Circle />} />
                <Route path="crew" element={<Circle />} />
                <Route path="tech" element={<Circle />} />
            </Route>
        </Routes>
    );
}

export default Sections;
